import logo from './logo.svg';
import r9 from './r9.svg';
import r10 from './r10.svg';
import r11 from './r11.svg';
import r12 from './r12.svg';
import r13 from './r13.svg';
import r14 from './r14.svg';
import txt from './txt.svg';
import s1 from './script.js';
import './App.css';
export default App;



function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="logo" alt="logo" />
        <img src={r9} className="backg" alt="backg" />
        <img src={r10} className="backg" alt="backg"></img>
        <img src={r13} className="backb" alt="backb"/>
        <button className='Button1'> <img src={r11}/></button>
        <button className='Button2'> <img src={r12}/></button>
        <button className='Button3'> <img src={r14}/></button>
        <img src={txt} className="txt" alt="txt"/>


        <p>
          <code>Bienvenue</code>
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React 
        </a>
      </header>
    </div>
  );
}
